import { useState, useEffect } from 'react';

function GetTitle(){
  const [articulos, setArticulos] = useState([])

  useEffect(() => {
    fetch('https://www.themealdb.com/api/json/v1/1/random.php')
      .then((response) =>response.json())
      .then((articulos) => {
        setArticulos(articulos)
      })
  }, [])
  return (
    <div>
      {articulos.meals[0]}
    </div>
  )
}
function App() {
  return (
    <div>
      <GetTitle/>
    </div>
  );
}
export default App;
